import React from 'react';
import PostListContainer from '../containers/posts/PostListContainer';

import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';

import qs from 'qs';
import Button from '../components/common/Button';
import { Link } from 'react-router-dom';
import PhoneIcon from '@material-ui/icons/Phone';

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <Typography
      component="div"
      role="tabpanel"
      hidden={value !== index}
      id={`scrollable-auto-tabpanel-${index}`}
      aria-labelledby={`scrollable-auto-tab-${index}`}
      {...other}
    >
      {value === index && <Box p={3}>{children}</Box>}
    </Typography>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.any.isRequired,
  value: PropTypes.any.isRequired,
};

function a11yProps(index) {
  return {
    id: `scrollable-auto-tab-${index}`,
    'aria-controls': `scrollable-auto-tabpanel-${index}`,
  };
}

const buildLink = ({ username, tag, page }) => {
  const query = qs.stringify({ tag, page });
  return username ? `/@${username}?${query}` : `/?${query}`;
};

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
    width: '100%',
    backgroundColor: theme.palette.background.paper,
  },
}));

const PostListPage = ({ page, lastPage, username, tag }) => {
  const classes = useStyles();
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };
  const [Page, setPage] = React.useState(
    <Link to={buildLink({ username, tag, page: 1 })}>1</Link>,
  );
  const onClick = ({}) => {
    const newPage = setPage();
  };

  return (
    <div className={classes.root}>
      <AppBar position="static" color="default">
        <Tabs
          value={value}
          onChange={handleChange}
          indicatorColor="primary"
          textColor="primary"
          variant="scrollable"
          scrollButtons="auto"
          aria-label="scrollable auto tabs example"
        >
          <Tab label="PAGE1" {...a11yProps(0)} icon={<PhoneIcon />} />
          <Tab
            label={
              <Link to={buildLink({ username, tag, page: 2 })}>PAGE2</Link>
            }
            {...a11yProps(1)}
            icon={<PhoneIcon />}
          />
          <Tab label="Item Three" {...a11yProps(2)} icon={<PhoneIcon />} />
          <Tab label="Item Four" {...a11yProps(3)} icon={<PhoneIcon />} />
        </Tabs>
      </AppBar>
      <TabPanel value={value} index={0}></TabPanel>
      <TabPanel value={value} index={1}>
        <PostListContainer />
      </TabPanel>
      <TabPanel value={value} index={2}>
        {buildLink({ username, tag, page: 1 })}
      </TabPanel>
      <TabPanel value={value} index={3}>
        {Page}
      </TabPanel>
      <TabPanel value={value} index={4}>
        Item Five
      </TabPanel>
      <TabPanel value={value} index={5}>
        Item Six
      </TabPanel>
      <TabPanel value={value} index={6}>
        Item Seven
      </TabPanel>
    </div>
  );
};

export default PostListPage;

